import React from 'react'
import { Card } from 'antd'
import { foodDishes, foodTable } from '../Components/Constant'

const { Meta } = Card

const Home = () => {
    return (
        <div className='container'>
            <div className='suggested'>Suggested for you</div>
            <div className='card-container'>
                {foodTable.map((item) => {
                    return (
                        <Card
                            hoverable
                            style={{
                                width: 'calc(25% - 25px)',
                                marginBottom: '20px',
                                marginRight: '25px',
                            }}
                        >
                            <div
                                style={{
                                    backgroundImage: `url(${item.url})`,
                                    height: 100,
                                    width: 100,
                                }}
                            ></div>
                            <Meta title='Waffles' description='https://thebelgianwaffle.co' />
                        </Card>
                    )
                })}
            </div>
        </div>
    )
}

export default Home
